// ResultPage.js

import React from 'react';

const ResultPage = ({ mbtiType, restartQuiz, svgUrls, backgroundImage }) => {
  return (
    <section className="question-container">
      <img src={`/images/${mbtiType}.png`} alt={mbtiType} />
      <p>Your MBTI Type: {mbtiType}</p>
      <button onClick={restartQuiz}>Restart Quiz</button>
    </section>
  );
};

export default ResultPage;
